import React from 'react'
import { Navigate, useNavigate } from 'react-router-dom'
import './sel.css'

function Selection() {
    let navigate=useNavigate();

    return (
        <div className='user'>
            <h1>Login</h1>
            <button onClick={()=>navigate('/sign-up')}>Customer</button>
           
        </div>
    )
}

export default Selection
